import React, { Component } from 'react'

export default class Card extends Component {




    render() {
        return (

            <div className="col-lg-4 my-2">
                <div className="card bg-dark">
                    <button className="btn btn-outline-primary  btn-lg " data-bs-toggle="collapse" href={"#".concat(this.props.info.name)} aria-expanded="false" >{this.props.info.name}</button>
                    <div className="card-body collapse" id={this.props.info.name}>
                        <h5 className="card-title card-title-style"> {this.props.info.meaning} </h5>
                        <h6 className='card-text card-example-style text-center mt-4'> Ã–rnekler</h6>

                        <div className='card-footer'>
                            <p className="card-text card-text-style">1. {this.props.info.examples1} </p>
                            <p className="card-text card-text-style">2. {this.props.info.examples2} </p>
                            <p className="card-text card-text-style">3. {this.props.info.examples3} </p>
                        </div>

                    </div>
                </div>
            </div>
        );
    
        
}
}
